import React from 'react';
import { Link } from 'react-router-dom'
import { Container } from '../CaixaCentral/styled';

export default function CaixaCentral() {
  return (
    <Container>
      <h1 class="titulo">Nome do Jogo</h1>
      <h3 class="descricao">A jogabilidade é mostrada em uma perspectiva de primeira ou terceira pessoa e o mundo pode ser atravessado a pé ou com veículos. Os jogadores controlam três protagonistas e podem alternar entre eles durante e fora das missões. A história é centrada em sequências de assaltos, com muitas missões envolvendo a jogabilidade de tiro e direção.</h3>
    </Container>
  )

}
